data:
A record so dreadful I listened to it all the way through just so I could note its passing, which I trust will be instantaneous. The worst of at least four modes: concept-rock, theater-rock, space-rock, and Anglo-Iberian, with a real live Spanish Person on castanets, vibes, and high heels. Ol�������;
This ought to be marked with a sic. They probably spell it humour, too, just like the phlegm in medieval medicine.
;
The packaging implies that this indifferent collection of patriotic songs is an anti-war record. Maybe I'm missing something, but it can't be worth four bucks.
;
The plus is because the title lets everyone make up his or her own joke.
